import { Card, Flex } from 'antd';

const { Meta } = Card;

function HomePage() {
    <Flex vertical align="center">
        <div>Hola</div>
        <Card
            hoverable
            style={{ width: 240 }}
            cover={<img alt="" src="../assets/img/volleyball.jpg" />}
        >
        <Meta title="Europe Street beat" />
    </Card>
    </Flex>

}

export default HomePage;
